package stalbans.inertiagames;public class Corner3GameEmbed extends SquareGameBoard {	public String getTitle() {		return "Corner 3";	}	public String getInstructionsLoc() {		return "text/corner3.html";	}	public RocketPanel newGamePanel() throws Exception {		return new CornerPanel(this);	}		public Rocket newStartingRocket() {		return new Rocket(20, 20, 2, 1);	}		public void initGamePanelHook() {		((CornerPanel)gamePanel).setCorner(360, 210);	}}